import Blog from "./Blog";



const Post = () => {
    const x = Blog.map(x =>
        'id: ' + x._id
        + 'title: ' + x.title
        + 'link: ' + x.link
        + 'image: ' + x.image
        + 'date: ' + x.date
        + 'content: ' + x.content
        + 'comments: ' + x.comments
        + 'comments: ' + x.comments
    );
    console.log(x);
    return <div>
        {x}

    </div>;
}

export default Post;




